  04> SUNDERLAND, Graeme Bruce m on 28.04.1984 to POWELL, Judith Ann
  b 05.12.1958
  b 16.11.1960
  Address: 911 Lyall Street, Hastings.
  Graeme works for Danny Bearsley growing produce for canning and fattening cattle for export beef.
  04> WILLIAMS, Marjorie m on 01.06.1915 to MACKAY, Lionel John Mytton Handcock
  b 30.05.1890 d 13.08.1970
  b 15.02.1884 d 19.01.1956
  Marjorie b. at Frimley, Hastings and both d. at Nelson and bd. at Lower Moutere.
  Lionel was educated at Wanganui Collegiate School and Auckland University (BA) and was ordained at Wells
  Cathedral. He served as a curate at Havelock North and Vicar of Ormondville and was later an orchardist at
  Lower Moutere. They retired about 1948 to live in Nelson.
  01> MACKAY, Denis Handcock m on 13.07.1946 to (1) YOUNGER, Mary Elizabeth
  b 19.03.1916
  b 27.03.1922
  Denis b, at Havelock North. He served in the Royal Navy from 1934 to 1957, was awarded the DSC and
  retired with the rank of Commander. Thereafter he worked in industry and was later employed in
  management consultancy until 1981.
  01> MACKAY, Lionel James m on 16.04.1977 to MARTYR, Alison Margaret
  b 28.01.1949
  b 16.07.1950
  Lionel b. at Edinburgh, Scotland and m. at Harrow, Middlesex, England. Alison, d/o Richard Graham
  Martyr and Dora Louisa Nissen. Address: 217 Cauldwell Hall Road, Ipswich, Suffolk, England.
  Lionel is an electrical engineer. From 1978 to 1990 he worked in developing village
  electrification with a Christian Mission in Nepal. Since 1990 he has worked in electricity
  distribution engineering in the United Kingdom.
  01> MACKAY, Ruth Ellen
  b 31.05.1979
  Ruth b. at Kathmandu, Nepal.
  02> MACKAY, Fiona Jane
  b 24.08.1981
  Fiona b. at Tansen, Nepal.
  02> MACKAY, Mariele Grace m on 29.08.1995 to SMITH, Martin Clive
  b 07.10.1952
  b 24.08.1953
  Mariele b. at Dorset, England. Martin, slo Claude and Ivy Smith. Address: Oakfield, 7 Pottery
  Lane, Wrecclesham, Farnham, Surrey GU10 4QJ, England.
  Mariele was educated at St Leonard's School in Scotland and Walnut Hill School in Massachusetts,
  USA. After college in London she came to New Zealand, and travelled and worked for three years.
  She then worked in London for many years. Martin is a tax partner in London for Coopers and
  Lybrand.
